import React from 'react';
import './home.scss';

const Home = () => {
    return (
        <div>
            <h1>Nos services</h1>
            <hr></hr>
            <div className='service'>
            <p>Cardio</p>
            <p>Musculation</p>
            <p>Pilates</p>
            </div>

            <img src='/images/Pulse.png'/>
            <img src='/images/Dumbbell.png'/>
            <img src='/images/Pilates.png'/>
        </div>
    )
}

export default Home;
